import { icons } from "../assets/icons/icons-svg";

export const listItemNavbar = [
    {
      id: 1,
      itemName: 'Trang chủ',
      icon: icons.iconHome,
      link: '/'
    },
    {
      id: 2,
      itemName: 'Sản phẩm',
      icon: icons.iconProduct,
      link: '/product'
    },
    {
      id: 3,
      itemName: 'Liên hệ',
      icon: icons.iconContact,
      link: '/contact'
    },
  ]
